export class AutresComplicationsSD {
    PatientId: number;
    Dhtr: boolean;
    Cholecystite: boolean;
    HepatiteCchroniquePostTransfusion: boolean;
    HepatiteBchroniquePostTransfusion: boolean;
    FracturesOsseuses: boolean;
    UlcereJambe: boolean;
    DateUlcereJambe?: string; // Use string for date to handle formatting issues
    SiegeUlcereJambe?: string;
    AutresComplications?: string;
    LithiasesBiliaires?: boolean;
  
    constructor() {
      this.PatientId = 0;
      this.Dhtr = false;
      this.Cholecystite = false;
      this.HepatiteCchroniquePostTransfusion = false;
      this.HepatiteBchroniquePostTransfusion = false;
      this.FracturesOsseuses = false;
      this.UlcereJambe = false;
      this.DateUlcereJambe = ''; // Initialize as empty string
      this.SiegeUlcereJambe = '';
      this.AutresComplications = '';
      this.LithiasesBiliaires = false;
    }
  }
